description:
Kieron Gillen and Rob Liefeld bring us this wacky Deadpool story. Promotional info from the first collected edition - &quot;The Deadpool Corps embark on the universe spanning mission that only they can accomplish. Tapped by the Elders of the Universe to gather a crack team of his alternative universe selves for what amounts to an intergalactic suicide mission, Deadpool just can't say no. Enter: Headpool, Kidpool, Dogpool and Lady Deadpool - and it's off to the rescue, right? Not so fast. Turns out another Elder, the Champion, isn't quite sold on this new super-team. If Deadpool and crew want to streak across the universe to face the ultimate enemy, their destiny, and much needed tacos and beer, they're going to have to pass a little test first.&quot;

Promo info for the second collected edition - &quot;How many Deadpools does it take to destroy an alien world? Fresh from inexplicably saving the galaxy, the Deadpool Corps is offered a mission by the Omega Confederation to squash a rebellion by the Krook people that is derailing the company's mining operation. Naturally, the Confederation is a little miffed upon learning the Corps has changed sides! Deadpool tries to modernize the Krook society so the people can defend themselves from invasion, at the same time attempting to win Princess Teela's affections. But her father, the king, challenges Deadpool's rise to power and his kingdom's industrialization. Leave it to Wade Wilson to incite a civil war. Father fights daughter, brother battles brother, and Lady Deadpool duels Deadpool! Will Wade and friends make it out alive, or will their meddling destroy the entire planet?&quot;

This is all 12 issues of the series + Deadpool Corps - Rank And Foul. Thanks to AnPymGold-Empire for these copies; please seed and enjoy! :-)
